INSERT INTO `lightraceracers` (`id`, `name`, `speed`, `image`, `fun_fact`) VALUES
(5, 'Nolan%2520Ryan%2520fastball', '100.00', 'fastball.png', 'Fastball%2520pitches%2520in%2520excess%2520of%2520105%2520mph%2520risk%2520tearing%2520the%2520ulnar%2520%28elbow%29%2520collateral%2520ligament%2520of%2520the%2520pitcher.'),
(6, 'Water%2520skier', '120.00', 'waterskier.png', 'Water%2520skiing%2520was%2520invented%2520by%2520an%252018-year-old%2520using%2520two%2520boards%2520and%2520some%2520clothesline%2520in%25201922.'),
(7, 'Peregrine%2520falcon', '242.00', 'peregrine_falcon.png', 'The%2520fastest%2520animal%2520in%2520the%2520world%252C%2520the%2520peregrine%2520falcon%2520has%2520been%2520trained%2520by%2520humans%2520to%2520hunt%2520for%2520birds%2520for%2520over%25203000%2520years.'),
(8, 'Danica%2520Patrick', '212.00', 'danica_patrick.png', '155%2520beats%2520per%2520minute%253B%2520A%2520NASCAR%2520racer%27s%2520heartbeat%2520of%2520155%2520beats%2520per%2520minute%2520is%2520the%2520same%2520as%2520that%2520of%2520a%2520marathon%2520runner.'),
(9, 'Paintball%2520pellet', '200.00', 'paintball.png', 'While%2520these%2520soft%2520grape-sized%2520balls%2520are%2520filled%2520with%2520washable%2520paint%252C%2520they%2520travel%2520at%2520170%2520to%2520204%2520mph%2520-%2520Splat%21'),
(10, 'SR-71%2520Blackbird', '2100.00', 'blackbird.png', 'The%2520SR-71%2520flew%2520so%2520fast%2520that%2520parts%2520of%2520its%2520titanium%2520skin%2520heated%2520up%2520to%2520over%2520950%25C2%25B0%2520F%2520%28510%25C2%25B0%2520C%29.'),
(11, 'Brook%2520trout', '23.00', 'brook_trout.png', 'The%2520brook%2520trout%2520is%2520so%2520popular%2520among%2520fishermen%2520that%2520it%2520is%2520the%2520state%2520fish%2520in%2520nine%2520different%2520states%252C%2520including%2520Virginia.'),
(12, 'RMS%2520Titanic', '28.00', 'titanic.png', 'On%2520its%2520first%2520%25E2%2580%2593%25C2%2580%25C2%2593%2520and%2520last%2520%25E2%2580%2593%2520voyage%252C%2520the%2520Titanic%2520was%2520trying%2520to%2520break%2520the%2520speed%2520record%2520for%2520crossing%2520the%2520Atlantic.%2520Despite%2520six%2520warnings%2520of%2520sea%2520ice%252C%2520it%2520was%2520still%2520traveling%2520at%2520near%2520its%2520maximum%2520speed%252C%252026%2520miles%2520per%2520hour%252C%2520when%2520it%2520hit%2520the%2520iceberg.'),
(13, 'USS%2520Virginia%2520%28SSN-774%29', '29.00', 'uss_virginia.png', 'The%2520USS%2520Virginia%2520%28SSN-774%29%252C%2520the%2520%2522fast%2520attack%2522%25C2%2580%25C2%259D%2520sub%252C%2520is%2520longer%2520than%2520a%2520football%2520field.'),
(14, 'Eastern%2520cottontail', '20.00', 'eastern_cottontail.png', 'When%2520pursued%2520by%2520predators%252C%2520an%2520eastern%2520cottontail%2520jumps%2520sideways%2520to%2520break%2520its%2520scent%2520trail.'),
(15, 'North%2520American%2520dragonfly', '18.00', 'north_american_dragonfly.png', 'Dragonflies%2520can%2520hover%2520like%2520a%2520helicopter%2520and%2520then%2520dart%2520off%2520instantly%2520in%2520any%2520direction%252C%2520even%2520backwards.%2520300%2520million%2520years%2520ago%2520some%2520dragonflies%2520had%2520a%2520wingspan%2520of%2520two%2520feet.'),
(16, 'Big-eared%2520bat', '40.00', 'big_eared_bat.png', 'A%2520big-eared%2520bat%25E2%2580%2599s%2520%25E2%2580%2598big%2520ears%25E2%2580%2599%2520make%2520up%2520nearly%2520a%2520quarter%2520of%2520their%2520length.'),
(17, 'North%2520American%2520jet%2520stream', '60.00', 'north_american_jet_stream.png', 'Jet%2520streams%2520move%2520mostly%2520west%2520to%2520east%252C%2520and%2520can%2520add%2520up%2520to%2520100%2520mph%2520to%2520an%2520airplane%27s%2520speed.'),
(18, 'Gulf%2520stream', '100.00', 'gulf_stream.png', 'Benjamin%2520Franklin%2520helped%2520chart%2520and%2520name%2520the%2520Gulf%2520stream%252C%2520which%2520allowed%2520sea%2520captains%2520to%2520reduce%2520travel%2520time%2520to%2520and%2520from%2520England%2520and%2520the%2520U.S.%2520by%2520two%2520weeks.'),
(19, 'Dump%2520truck%2520on%2520the%2520freeway', '65.00', 'dump_truck.png', 'Dump%2520trucks%2520get%2520approximately%2520three%2520miles%2520per%2520gallon.'),
(20, 'Human%2520sneeze', '40.00', 'sneeze.png', 'Humans%2520do%2520not%2520sneeze%2520when%2520they%2520are%2520asleep.'),
(21, 'AMC%2520Gremlin', '80.00', 'gremlin.png', '%2522Gremlin%2522%2520means%2520a%2520small%2520gnome%2520responsible%2520for%2520mechanical%2520failures.'),
(22, 'Atlantic%2520sailfish', '68.00', 'atlantic_sailfish.png', 'At%252068%2520mph%252C%2520the%2520atlantic%2520sailfish%2520is%2520the%2520fastest%2520fish%2520in%2520the%2520ocean.'),
(23, 'Cheetah', '70.00', 'cheetah.png', 'Cheetahs%2520can%2520accelerate%25200-60%2520mph%2520in%2520three%2520seconds%252C%2520faster%2520than%2520a%2520Stingray%2520or%2520a%2520Porsche.'),
(24, 'Commercial%2520jet', '560.00', 'commercial_jet.png', 'The%2520largest%2520commercial%2520jet%252C%2520the%2520Airbus%2520A380%252C%2520holds%2520up%2520to%2520853%2520people%2520and%2520costs%2520%2524428%2520million.'),
(25, 'Olympic%2520sprinter%2520-%2520Usain%2520Bolt', '27.80', 'sprinter.png', 'At%2520top%2520speed%252C%2520Usain%2520Bolt%2520can%2520run%2520the%2520length%2520of%2520a%2520basketball%2520court%2520in%2520less%2520than%25202.5%2520seconds.'),
(26, 'F-35%2520Lightning', '1200.00', 'f17_lightning.png', 'The%2520F-35%2520Lightning%2520contains%2520approximately%2520300%252C000%2520individual%2520parts.'),
(27, 'Cardinal', '25.00', 'cardinal.png', 'Male%2520cardinals%2520can%2520sing%2520up%2520to%2520200%2520songs%2520in%2520an%2520hour.'),
(28, 'Snapping%2520turtle', '2.40', 'snapping_turtle.png', 'The%2520snapping%2520turtle%2520can%2520extend%2520its%2520head%2520and%2520strike%2520as%2520fast%2520as%2520a%2520rattlesnake.'),
(29, 'Homing%2520pigeon', '90.00', 'homing_pidgeon.png', 'In%2520just%2520one%2520day%252C%2520a%2520champion%2520racing%2520pigeon%2520can%2520fly%2520home%2520from%2520400-600%2520miles%2520away.'),
(30, 'Wild%2520turkey', '35.00', 'wild_turkey.png', 'The%2520wild%2520turkey%25E2%2580%2599s%2520bald%2520head%2520can%2520change%2520color%2520in%2520seconds%2520with%2520excitement%2520or%2520emotion.'),
(31, 'Red-tailed%2520hawk', '121.20', 'red-tail_hawk.png', 'A%2520red-tailed%2520hawk%2520can%2520spot%2520a%2520mouse%2520from%2520100%2520feet%2520up%2520in%2520the%2520air%25C3%25A2%25C2%2580%25C2%2594about%2520ten%2520stories%2520high.'),
(32, 'Bald%2520eagle', '35.00', 'bald_eagle.png', 'Bald%2520eagles%2520build%2520large%2520nests%252C%2520sometimes%2520weighing%2520as%2520much%2520%250Aas%2520a%2520ton.'),
(33, 'Canada%2520goose', '55.00', 'canada_goose.png', 'Canada%2520geese%2520can%2520fly%2520to%2520an%2520altitude%2520of%2520at%2520least%252029%252C000%2520ft%2520during%2520migrations.'),
(34, 'Masai%2520warrior%2520chased%2520by%2520rhinoceros', '18.40', 'masai_warrior.png', 'Custom%2520dictates%2520that%2520a%2520Masai%2520warrior%2520can%2520never%2520eat%2520or%2520drink%2520alone%252C%2520only%2520with%2520at%2520least%2520one%2520other%2520warrior.'),
(35, 'African%2520rhinoceros', '30.00', 'african_rhinoceros.png', 'A%2520group%2520of%2520rhinoceroses%2520is%2520%250Acalled%2520a%2520crash.'),
(36, 'Indian%2520elephant', '25.00', 'indian_elephant.png', 'Elephants%2520normally%2520sleep%2520only%2520two%2520or%2520three%2520hours%2520each%2520day.'),
(37, 'African%2520elephant', '24.90', 'african_elephant.png', 'African%2520elephants%2520can%2520eat%2520up%2520to%2520660%2520pounds%2520and%2520drink%2520up%2520to%252050%2520gallons%2520in%2520a%2520single%2520day.'),
(38, 'Red%2520fox', '30.00', 'red_fox.png', 'The%2520red%2520fox%2520can%2520make%252028%2520different%2520sounds%2520to%2520communicate.'),
(39, 'Gray%2520squirrel', '15.00', 'gray_squirrel.png', 'Each%2520year%2520a%2520squirrel%2520typically%2520stores%2520food%2520in%2520several%2520thousand%2520hiding%2520places%2520or%2520caches.'),
(40, 'Monarch%2520butterfly', '12.00', 'butterfly.png', 'All%2520butterflies%252C%2520including%2520the%2520monarch%252C%2520taste%2520with%2520their%2520feet.'),
(41, 'Bottlenose%2520dolphin', '22.00', 'bottlenose_dolphin.png', 'Large%2520pods%2520of%2520dolphins%2520can%2520have%25201%252C000%2520members%2520or%2520more.'),
(42, 'Secretariat', '37.00', 'secretariat.png', 'Secretariat%2520was%2520the%2520was%2520the%2520only%2520non-human%2520on%2520ESPN%27s%2520100%2520Greatest%2520Athletes%2520of%2520the%2520Twentieth%2520Century.'),
(44, 'Lionel%2520Messi%2520kick', '65.00', 'soccer_kick.png', 'An%2520average%2520soccer%2520player%2520runs%2520about%2520seven%2520miles%2520in%2520a%252090-minute%2520match.'),
